// ImageResource =============================================
// An object that stores an image.

var ImageResource = function(name, data) {
  this.name = name;

  // Data source image:
  // http://images.clipartpanda.com/animated-question-mark-for-powerpoint-1256186461796715642question-mark-icon.svg.hi.png
  this.data = arguments.data || (
    "data:image/png;base64,"
  )
};

// Project ===================================================

var Project = function() {
  // A sprite is just an object that can move around,
  // draw things, etc on the stage.
  this.sprites = [];

  // The resources object contains all the resources
  // for the project.
  this.resources = {
    images: [],
    sounds: []
  };
};

// SoundResource =============================================
// An object that stores a piece of sound.

var SoundRecource = function(name, data) {
  this.name = name;
  this.data = data;
};
